import { 
  BrowserRouter as Router,
  Switch,
  Route, 
} from "react-router-dom";
import './App.css';
import Homepage from './component/homepage';
import School from './component/school';
import Jobs from './component/jobs';
import Passions from './component/passions';
import Nav from './component/navigation/';
import Page404 from "./component/page404";
import Redux from './component/redux';
import { useDispatch, useSelector } from 'react-redux';
import { clicks } from './actions';

function App() {

  const user = useSelector(state => state.user);
  const action = useDispatch();
  document.querySelector('*').addEventListener('click', event => {
    action(clicks(event))
  })

  return (
    <Router>
      <div className="App">

        <Nav />
        <Switch>
          <Route path="/" exact component={Homepage}/>
          <Route path="/school" component={School}/>
          <Route path="/jobs" component={Jobs}/>
          <Route path="/passions" component={Passions}/>
          <Route path="/redux" component={Redux}/>
          {user !== guest ? null : <Route path="/WhereDoesItComeFrom" component={WhereDoesItComeFrom}/>}
          <Route>
            <Page404 path="*"/>
          </Route>
        </Switch>

      </div>
    </Router>
  );
}

export default App;
